import React from "react";
import { withRouter} from 'react-router-dom';
import ReactTable from 'react-table'


class Searchtable extends React.Component {
render(){
    const data = [{
        name: 'Roy Agasthyan',
        age: 26
      },{
        name: 'Sam Thomason',
        age: 22
      },{
        name: 'Michael Jackson',
        age: 36
      },{
        name: 'Samuel Roy',
        age: 56
      },{
        name: 'Rima Soy',
        age: 28
      },{
        name: 'Suzi Eliamma',
        age: 28
      }]

      const columns = [{
        Header: 'Name',
        accessor: 'name'
      },{
        Header: 'Age',
        accessor: 'age'
      }]


      return (
        <div>
            <MUIDataTable
              data={data}
              columns={columns}
            />
        </div>      
  )
}
}
export default withRouter(Searchtable);
